import React from 'react';

import './scrape.css';

export default function Scrap(){

    handleClick =()=>{
        alert('I have been alerted');
    }

    return(
        <div className="scrapeOuterContainer" id="sOuterBox">
            <button className="" onClick={handleClick}>Scrape</button>
        </div>
    );
}
